    function addPosition(Position memory _newPosition) internal {
        // Initialize the Position in memory
        positionLedger[msg.sender].push(_newPosition);
    }
    
    function removePosition(uint256 _index) internal {
        // TODO Fix this being storage, use a memory array instead, or modify in place
        Position[] storage currentPositions = positionLedger[msg.sender];
        delete currentPositions[_index];
        currentPositions[_index] = currentPositions[currentPositions.length-1];
        delete currentPositions[currentPositions.length-1];
        positionLedger[msg.sender] = currentPositions;
    }
    function viewPositions(address _personOfInterest) public view returns(Position[] memory) {
        return positionLedger[_personOfInterest];
    }
    function createPosition(bool _isLong, address _asset, address _stablecoin, uint8 _loops) public {
        // Define known parameters into a new position into memory
        Position memory newPosition;
